import React from 'react';
import LucasFace from "../assets/Lucas_Pao.JPG";
import {Redirect} from 'react-router-dom';

class Experience extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            redirectLink: "/experience"
        };
    }

    handleClick(page) {
        const link = this.state.redirectLink.concat(page);
        this.setState({redirectLink: link})
    }

    render() {
        if(this.state.redirectLink !== "/experience") {
            return <Redirect to={this.state.redirectLink}/>
        }
        return (
            <div>
                <h1>Experience</h1>
                <div>Education</div>
                <div>
                    Sep 2019 - May 2023: HARVARD UNIVERSITY Cambridge, MA 
                    B.A. in Computer Science (Honors), Minor in Mathematics Honors: cum laude
                </div>
                <div className="expLayout">

                    <div className='expLeft'>
                        <h2>{'\u2304'}</h2>
                        <h2>{'\u27a4'}</h2>
                        <h2>Python (Flask)</h2>
                            <ul>
                                <li>Project: CSCS: Computer Science Course Selector</li>
                                <li>Project: PolySympth Synthesizer</li>
                                <li>Experience: Photon Commerce</li>
                                <li>Experience: TapJams</li>
                            </ul>
                        <h2>JavaScript (React, React Native)</h2>
                            <ul>
                                <li>Project: VotrCrowd</li>
                                <li>Experience: Datamatch</li>
                                <li>Experience: PlayHouse</li>
                                <li>Experience: TapJams</li>
                            </ul>
                    </div>
                    <div className='expRight'>
                        <h2>Swift</h2>
                            <ul>
                                <li>Experience: Capital One</li>
                            </ul>
                        <h2>R (Shiny)</h2>
                            <ul>
                                <li>Project: Interactive Abstract Math Viz Apps</li>
                            </ul>
                    </div>
                </div>
            </div>
        );
    }
}

export default Experience;
